import React from 'react';
import EventCard from './EventCard';

const events = [
  {
    title: "Event Title 1",
    date: "2024-09-30",
    description: "This is a description of Event 1.",
    location: "Example Location",
    imageUrl: "image1.jpg"
  },
  {
    title: "Event Title 2",
    date: "2024-10-01",
    description: "This is a description of Event 2.",
    location: "Another Location",
    imageUrl: "image2.jpg"
  },
  // Add more events as needed
];

const EventsList = () => {
  const handleLeftClick = () => {
    // Logic for left arrow click
  };

  const handleRightClick = () => {
    // Logic for right arrow click
  };

  return (
    <div className="events-container">
      <h1>Upcoming Events</h1>
      <div className="events-list">
        <button className="arrow-button left" onClick={handleLeftClick}>←</button>
        {events.map((event, index) => (
          <EventCard 
            key={index} 
            title={event.title} 
            date={event.date} 
            description={event.description} 
            location={event.location} 
            imageUrl={event.imageUrl} 
          />
        ))}
        <button className="arrow-button right" onClick={handleRightClick}>→</button>
      </div>
    </div>
  );
};

export default EventsList;
